import React from 'react'
import '../App.css'

const AboutUs = () => {
  return (
    <div className='about'>
        <h1 className='vision'>Our Vision</h1>
        <p>We aim at depicting cultural diversity in a fashionable way through love with style, art, story telling and unique pieces for you. Emphasis on making every woman feel classy, confident and fashionable in a deliberate way. Luxury must be comfortable otherwise it is not Luxury “ the beauty of the clothing you wear should illustrate the happiness you feel”.</p>
      </div>
  )
}

export default AboutUs
